function App() {

  const jsonData = useRef();


  const onSubmit = event => {
   event.preventDefault();
  };



  return (
    <div className="App">
      <form onSubmit={onSubmit}>
        <input ref={jsonData} type="search" id="search"></input>
        <button type="submit">Search</button>


      </form>
    </div>
  );
}

export default App;
